"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Bonner HS and Shaw LM, &ldquo;New Dosing Regimens for Amifostine: A Pilot Study to Compare the Relative Bioavailability of Oral and Subcutaneous Administration With Intravenous Infusion,&rdquo;",
