var title_f0_42_684="High risk trauma mechanisms";
var content_f0_42_684=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F57293&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F57293&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Trauma mechanisms associated with a high risk of injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Blunt",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Motor vehicle collision",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ejection from the automobile",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Death of  another passenger in same vehicle compartment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vehicle roll over",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        High speed automobile crash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        &bull; Initial speed &gt;40 mph (64 kph)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        &bull; Auto deformity &gt;20 inches (50 cm)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        &bull; Intrusion into passenger compartment &gt;12 inches (30 cm)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Extrication time &gt;20 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Motorcycle crash &gt;20 mph (32 kph) or with separation of rider from bike",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Motor vehicle pedestrian injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pedestrian thrown or run over",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Automobile-pedestrian injury with &gt;5 mph (8 kph) impact",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Falls",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Adult: &gt;20 ft (6 m)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Child: &gt;10 ft (3 m) or more than 2 to 3 times patient height",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Penetrating",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any penetrating trauma to head, neck, chest, abdomen, or extremities proximal to elbow or knee",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reference: American College of Surgeons Committee on Trauma. Resources for Optimal Care of the Injured Patient. American College of Surgeons Chicago, IL 2006, p. 22.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
